sub score_word {
    my ($guess, $answer) = @_;
    my @guess = split('', $guess);
    my @answer = split('', $answer);
    my @exact;
    my @miss;
    for my $i (0..$#guess) {
        $exact[$i]++ if ($guess[$i] eq $answer[$i]);
    }
    my %found;
    LOOP: for my $i (0..$#guess) {
        next if $exact[$i];
        my $let = $guess[$i];
        my $start = $found{$let} || 0;
        for my $j ($start..$#answer) {
            next if $exact[$j];
            if ($let eq $answer[$j]) {
                $miss[$i]++;
                $found{$let} = $i + 1;
                next LOOP;
            }
        }
        $found{$let} = @answer;
    }
    my $res ;
    for my $i (0..$#guess) {
        if ($exact[$i]) {
            $res .= '*';
        } elsif ($miss[$i]) {
            $res .= '-';
        } else {
            $res .= '.';
        }
    }
    return $res;
}

memoize('score_word');

sub split_answers {
    my $answers = shift;
    my $guess = shift;
    my %out;
    for my $a (@$answers) {
        push @{$out{score_word($guess, $a)}}, $a;
    }
    return \%out;
}

# in nats
sub entropy {
    my $sets = shift;
    my @sizes = map {scalar(@$_)} @$sets;
    my $total = sum(@sizes);
    my $res = 0;
    for my $s (@sizes) {
        my $p = $s/$total;
        $res-= $p * log($p);
    }
    return $res;
}

sub rank_guesses {
    my $answers = shift;
    my $words = shift // \@ALLWORDS;
    # To reduce repeat computation, @ALLWORDS is pre-sorted based on rank_guesses
    return @ALLWORDS if (@$words == @ALLWORDS && @$answers == @ANSWERS);
    return @ANSWERS if (@$words == @ANSWERS && @$answers == @ANSWERS);
    #return ("irate") if (@$words == @ALLWORDS);
    my @out;
    my $i;
    for my $g (@$words) {
        #say STDERR $i unless (++$i & ((1<<12) - 1));
        my $splits = split_answers($answers, $g);
        my @splits = values(%$splits);
        my $ent = entropy(\@splits);
        if ($splits->{'*****'}) {
            $ent+=1e-9;
        }
        push @out, [$ent, $g];
    }
    my @gout = map {$_->[1]} (sort {$b->[0] <=> $a->[0]} (@out));
    return @gout;
}

sub quality {
    my $res = shift;
    my $r2 = $res;
    $res =~ s/[^\*]//go;
    $r2 =~ s/[^\-]//go;
    return length($res)*5 + length($r2);
}

sub mktree {
    my $answers = shift;
    my $words = shift // \@ALLWORDS;
    my $depth = shift;
    my $hard = shift;
    return undef unless $depth;
    return [@$answers] if (@$answers == 1);
    return undef unless $depth > 1;
    #say STDERR "[$depth] ", join(';', @$answers);
    my @guesses = rank_guesses($answers, $words);
    my $i=0;
    GUESS: for my $g (@guesses) {
        #say STDERR "[$depth] TRYING GUESS $g";
        last if ($i++ > 100);
        my $splits = split_answers($answers, $g);
        my $gsplits = $hard ? split_answers($words, $g) : undef;
        my %tree;
        my @skeys;
        if ($hard) {
            @skeys = sort {quality($b) <=> quality($a)} keys(%$splits);
        } else {
            @skeys = sort {@{$splits->{$b}} <=> @{$splits->{$a}}} keys(%$splits);
        }
        for my $k (@skeys) {
            next if $k eq '*****';
            my $count = @{$splits->{$k}};
            say STDERR "[$depth] Pattern $k for $g ($count words)" if ($count > 50);
            if ($hard && quality($k) >= 20 && $count >= $depth-1) {
                #say STDERR "early break depth=$depth count=$count";
                next GUESS;
            }
            my $allowed_guesses = $hard ? $gsplits->{$k} : $words;
            my $subtree = mktree($splits->{$k}, $allowed_guesses, $depth - 1, $hard);
            next GUESS unless $subtree;
            $tree{$k} = $subtree;
        }
        return [$g, \%tree];
    }
    return undef;
}

say encode_json(mktree(\@ANSWERS,\@ANSWERS, 6, 1));
